import React from "react";
import { Switch, Route, Redirect } from "react-router";
interface RouteConfig {
  key?: string;
  path: string;
  exact?: boolean;
  component?: any;
  render?: Function;
  routes: [];
}
type Props = RouteConfig[];

export default function RenderRoutes(routes: Props | undefined) {
  return (
    <Switch>
      {routes?.map((route, index): any => {
        <Route
          key={route.path?.toString()}
          path={`${route.path}`}
          exact={route.exact}
          component={route.component}
        />;
        // <Route
        //   key={route.path?.toString()}
        //   path={`${route.path}`}
        //   exact={route.exact}
        //   component={route.component}
        // />
      })}
      {/* <Redirect from="/home" to="/home/overall/national-trend" /> */}
    </Switch>
  );
}
